import {
    Index,
    Classify,
    Fengwei
} from "../page"



export const mainRoutes =[
    {
        path:"/index",
        component:Index
    },
    {
        path:"/classify",
        component:Classify
    },
    {
        path:"/fengwei",
        component:Fengwei
    }
]
